const input = $input.item;
const binary = input.binary?.data;

if (!binary) {
  throw new Error('No file provided in request');
}

const allowedMimes = [
  'image/jpeg', 'image/png', 'image/heic', 'image/heif',
  'application/pdf', 'application/msword',
  'application/vnd.openxmlformats-officedocument.wordprocessingml.document'
];

if (!allowedMimes.includes(binary.mimeType)) {
  throw new Error(`Unsupported file format: ${binary.mimeType}`);
}

return {
  json: {
    fileName: binary.fileName,
    mimeType: binary.mimeType,
    clientIp: input.json.headers?.['x-forwarded-for']?.split(',')[0]?.trim()
              || input.json.headers?.['x-real-ip']
              || 'unknown'
  },
  binary: input.binary
};

const staticData = $getWorkflowStaticData('global');
const now = Date.now();
const HOUR_MS = 3600000;
const MAX_REQUESTS_PER_HOUR = 5;

// Initialize rate limit store
if (!staticData.rateLimits) {
  staticData.rateLimits = {};
}

const clientIp = $input.item.json.clientIp;
const key = `cv-extract:${clientIp}`;

// Clean expired entries (older than 1 hour)
for (const [k, v] of Object.entries(staticData.rateLimits)) {
  if (now - v.windowStart > HOUR_MS) {
    delete staticData.rateLimits[k];
  }
}

// Check and update rate limit
let record = staticData.rateLimits[key];
if (!record || now - record.windowStart > HOUR_MS) {
  record = { count: 0, windowStart: now };
}

record.count++;
staticData.rateLimits[key] = record;

if (record.count > MAX_REQUESTS_PER_HOUR) {
  const retryAfter = Math.ceil((record.windowStart + HOUR_MS - now) / 1000);
  throw new Error(`RATE_LIMITED:${retryAfter}`);
}

return $input.item;

const input = $input.item;
const binary = input.binary.data;
const mimeType = input.json.mimeType;

// Size limits (bytes)
const SIZE_LIMITS = {
  'image/jpeg': 10 * 1024 * 1024,  // 10MB
  'image/png': 10 * 1024 * 1024,
  'image/heic': 10 * 1024 * 1024,
  'image/heif': 10 * 1024 * 1024,
  'application/pdf': 25 * 1024 * 1024  // 25MB
};

// Magic bytes (hex prefixes)
const MAGIC_BYTES = {
  'image/jpeg': ['ffd8ff'],
  'image/png': ['89504e47'],
  'application/pdf': ['25504446']
};

// Decode first 8 bytes for magic check
const base64Data = binary.data;
const rawBytes = Buffer.from(base64Data, 'base64');
const fileSize = rawBytes.length;

// Check size limit
const maxSize = SIZE_LIMITS[mimeType] || 10 * 1024 * 1024;
if (fileSize > maxSize) {
  throw new Error(`File too large: ${(fileSize / 1024 / 1024).toFixed(1)}MB exceeds ${(maxSize / 1024 / 1024)}MB limit`);
}

// Check magic bytes for known types
const magicPatterns = MAGIC_BYTES[mimeType];
if (magicPatterns) {
  const headerHex = rawBytes.slice(0, 4).toString('hex').toLowerCase();
  const isValid = magicPatterns.some(pattern => headerHex.startsWith(pattern));
  if (!isValid) {
    throw new Error('File content does not match declared type');
  }
}

return {
  json: { ...input.json, fileSize },
  binary: input.binary
};

const input = $input.item.json;
const obj = input.object || input;

// Handle both XML-parsed and direct object responses
const cvExtraction = obj.cv_extraction || obj;
const summary = cvExtraction.candidate_summary || obj.candidate_summary || {};
const content = cvExtraction.extracted_content || obj.extracted_content || '';

// Extract markdown from CDATA if present
let markdown = content;
if (typeof content === 'string' && content.includes('CDATA')) {
  const match = content.match(/<!\[CDATA\[([\s\S]*?)\]\]>/);
  markdown = match ? match[1] : content;
}

return {
  json: {
    full_name: summary.full_name || 'Not specified',
    title: summary.title || 'Professional',
    location: summary.location || 'Not specified',
    extracted_text: (markdown || '').trim(),
    confidence: cvExtraction.confidence_score || obj.confidence_score || null,
    debug_id: $execution.id
  }
};
